INSERT INTO `answer` VALUES ('88', '<div>2018.03.07 下去收到阿里面试的电话。整个过程持续40-50分钟左右。</div><div>下面是面试官问的一些问题。</div><div><br></div><div>（1）自我介绍</div><div>（2）说说你的项目吧</div><div>（3）项目中遇到过哪些问题，怎么解决的</div><div>（4）maven中两个冲突包依赖其他包，怎么处理</div><div>（5）pom.xml中有哪些配置</div><div>（6）string,stringbuilder,strungbuffer的原理区别。</div><div>（7）string中的+是怎么执行的</div><div>（8）string为什么是不可变</div><div>（9）int和integer的区别,具体应用</div><div>（10） 什么时候使用integer</div><div>（11）Java内存模型</div><div>（12）GC原理</div><div>（13）抽象类和接口的不同</div><div>（14）set和list</div><div>（15）hashmap底层原理，存取过程</div><div>（16）currenthashmap底层原理，安全性</div><div>（17）程序中为什么要使用多线程</div><div>（18）线程是不是越多越好，一般设置多少个</div><div>（19）电脑CPU为4...。适合设置多少个线程</div><div>（20）用过哪些创建线程方法</div><div>（21）callable原理</div><div>（22）谈一谈对spring的理解</div><div>（23）spring实现原理</div><div>（24）设计模式还了解哪些，解释一下</div><div>（25）http状态码</div><div>（26）cookie和session区别</div><div>（27）session原理</div><div>（28）sessionID除了放cookie还可以放在哪</div><div>（29）数据库四大特性</div><div>（30）事务隔离级别</div><div>（31）可重复读是怎么实现的，底层原理</div><div>（32）数据库优化</div><div>（33）哪些地方适合加索引</div><div>（34）排序算法及时间复杂度</div><div>（35）快排nlogn怎么算的</div><div>（36）解释归并算法，时间复杂度，稳定性</div><div>（37）一堆数，找出最大的10个。用什么算法及时间复杂度。堆排序具体怎么实现。</div><div>（38）你有什么想问的。</div><div><br></div>', '1', '0', '1545483275817', '3', '45e6c1985fe640e09cd770d95e6e2c8b');
